export const FooterForm = () => {

    const contactFormSubmit = (e) =>{
        e.preventDefault();
        let contactForm = new FormData(e.target)
        console.log(contactForm.get('text'));
        
    }

    return (
        <div className="contact-form">
            <h2>Пиши ни</h2>
            <form className="input-group" onSubmit={contactFormSubmit}>
                <input className="input-group-field" type="text" placeholder="Име" />
                <input className="input-group-field" type="email" placeholder="Email адрес" />
                <textarea placeholder="Съобщение"></textarea>
            <button className="send" type='submit' href="#">Изпрати</button>
            </form>
        </div>
    )
}
